when { string == "foo" -> 2 string == "bar" -> { doSomeStuff() 3 } otherCondition() -> 4
} Each when branch consists of a condition, and a statement. If the given condition is true, the corresponding statement will be executed. Whens are very similar to if/elseif/else control flow, but they allow you to return values . They are useful to assign variables, or returning values in functions. In the above example, you can notice that a default case is missing. If no conditions matched, the when will return null. This means that you must always specify an else branch for whens returning primitive types, as they cannot be null. int myInt = when { string == "foo" -> 2 string == "bar" -> { doSomeStuff() 3 } string == someString() -> 4 otherCondition() -> 5 else -> 5
}

